import {Injectable} from '@angular/core';
import {Observable} from "rxjs";
import {Message} from "../interfaces/message";

@Injectable()
export class AppService {
  //Mock data - messages
  public messages = [
    {
      id: 1,
      sender: 'Calum',
      text: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.',
      expirationDt: 'Fri Mar 02 2018 00:00:00 GMT+0200 (Eastern Europe Standard Time)',
      attachment: 'data:image/png;base64,'
    },
    {
      id: 2,
      sender: 'Dima',
      text: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.',
      expirationDt: 'Fri Mar 16 2018 00:00:00 GMT+0200 (Eastern Europe Standard Time)',
      attachment: 'data:image/jpeg;base64,'
    }
  ];

  constructor() {
  }

  loadMessages() {
    const resultMessages: Array<Message> = [];
    this.messages.forEach((message: Message) => {
      if (new Date(Date.now()) < new Date(message.expirationDt)) {
        resultMessages.push(message);
      }
    });
    return Observable.of(resultMessages);
  }

  updateMessageById(message: Message) {
    Object.assign(this.messages.find(m => m.id === message.id), message);
    return Observable.of('OK');
  }
}
